import React from "react";

const chats = [
  {
    name: "Bob",
    message: "New unread message!",
    time: "13:10",
    unread: true,
    active: true,
  },
  {
    name: "Charlie",
    message: "Thanks a lot!",
    time: "15:10",
    unread: false,
    active: false,
  },
  {
    name: "Alice",
    message: "Did you get the contract?",
    time: "22:34",
    unread: false,
    active: false,
  },
];

export default function ChatsScreen({ onDisconnect }) {
  return (
    <div
      style={{
        minHeight: "100vh",
        background: "#100E0A",
        color: "#FFC32B",
        fontFamily: "'Piedra', cursive",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        padding: "28px 0 0 0",
        boxSizing: "border-box",
      }}
    >
      {/* Brand */}
      <div
        style={{
          fontFamily: "'Orbitron', sans-serif",
          fontWeight: 700,
          fontSize: 36,
          letterSpacing: "0.04em",
          color: "#FFC32B",
          marginBottom: 12,
          textShadow: "0 0 12px #FFC32B99, 1px 1px 0px #FFD700",
        }}
      >
        R&#x039E;AXTIV
      </div>
      {/* Chats title */}
      <div
        style={{
          fontFamily: "'Piedra', cursive",
          fontSize: 36,
          color: "#FFC32B",
          textShadow: "0 1px 8px #FFD700, 0 0px 8px #FFC32B44",
          marginBottom: 12,
          marginRight: "auto",
          marginLeft: 36,
        }}
      >
        Chats
      </div>
      {/* Search */}
      <input
        type="text"
        placeholder="Search chat, ENS or address"
        style={{
          width: "84%",
          padding: "16px 22px",
          margin: "0 0 18px 0",
          border: "none",
          borderRadius: 28,
          background: "#232323",
          color: "#fff",
          fontSize: 18,
          fontFamily: "'Piedra', cursive",
          outline: "none",
        }}
      />
      {/* Chats list */}
      <div style={{ width: "92%", flex: 1 }}>
        {chats.map((chat, idx) => (
          <div
            key={chat.name}
            style={{
              display: "flex",
              alignItems: "center",
              background: "#232323",
              borderRadius: 28,
              padding: "14px 16px",
              marginBottom: 16,
              position: "relative",
              boxShadow: chat.unread
                ? "0 0 12px #FFC32B33"
                : "0 1px 2px #00000044",
            }}
          >
            {/* Avatar */}
            <div
              style={{
                width: 44,
                height: 44,
                background: "#FFC32B",
                borderRadius: "50%",
                marginRight: 16,
                flexShrink: 0,
              }}
            ></div>
            {/* Info */}
            <div style={{ flex: 1 }}>
              <div
                style={{
                  fontWeight: 700,
                  fontSize: 20,
                  color: "#FFC32B",
                  fontFamily: "'Piedra', cursive",
                }}
              >
                {chat.name}
              </div>
              <div
                style={{
                  color: chat.unread ? "#FFC32B" : "#fff",
                  fontSize: 17,
                  fontWeight: chat.unread ? 700 : 400,
                  marginTop: 2,
                  fontFamily: "'Piedra', cursive",
                }}
              >
                {chat.message}
              </div>
            </div>
            {/* Time and status */}
            <div style={{ textAlign: "right", marginLeft: 12 }}>
              <div
                style={{
                  color: "#FFC32B",
                  fontSize: 15,
                  fontFamily: "'Piedra', cursive",
                  marginBottom: 2,
                }}
              >
                {chat.time}
              </div>
              {/* Online dot */}
              {chat.active && (
                <span
                  style={{
                    display: "inline-block",
                    width: 12,
                    height: 12,
                    background: "#23F600",
                    borderRadius: "50%",
                  }}
                />
              )}
            </div>
          </div>
        ))}
      </div>
      {/* Bottom nav */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-around",
          alignItems: "center",
          width: "100%",
          position: "fixed",
          bottom: 0,
          left: 0,
          background: "#100E0A",
          padding: "18px 0 9px 0",
          borderTop: "1.5px solid #232323",
        }}
      >
        {/* Puedes reemplazar estos emojis por SVGs personalizados */}
        <div style={{ textAlign: "center" }}>
          <span style={{ fontSize: 34, color: "#FFC32B" }}>üí¨</span>
          <div style={{ color: "#FFC32B", fontFamily: "'Piedra', cursive", fontSize: 22 }}>
            Chats
          </div>
        </div>
        <div style={{ textAlign: "center" }}>
          <span style={{ fontSize: 34, color: "#FFC32B" }}>‚úàÔ∏è</span>
          <div style={{ color: "#FFC32B", fontFamily: "'Piedra', cursive", fontSize: 22 }}>
            Send
          </div>
        </div>
        <div style={{ textAlign: "center" }}>
          <span style={{ fontSize: 34, color: "#FFC32B" }}>üë•</span>
          <div style={{ color: "#FFC32B", fontFamily: "'Piedra', cursive", fontSize: 22 }}>
            Groups
          </div>
        </div>
        <div style={{ textAlign: "center" }}>
          <span style={{ fontSize: 34, color: "#FFC32B" }}>üõ†Ô∏è</span>
          <div style={{ color: "#FFC32B", fontFamily: "'Piedra', cursive", fontSize: 22 }}>
            Settings
          </div>
        </div>
      </div>
    </div>
  );
}
